import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { MiPersonajeComponent } from './MisPersonajes/miPersonaje/miPersonaje.component';
import { ListadoMisPersonajesComponent } from './MisPersonajes/listadoMisPersonajes/listadoMisPersonajes.component';
import { FormsModule } from '@angular/forms';

import { HttpClientModule } from '@angular/common/http';


@NgModule({
  declarations: [
    MiPersonajeComponent,
    PrincipalComponent,
    ListadoMisPersonajesComponent,
    FiltroApiWebComponent,
    ListadoFiltroApiWebComponent,
    BuscaTFormaApiWebComponent,
    ListadoTFormaApiWebComponent
  ],
  imports: [
    CommonModule,
    FormsModule,
    HttpClientModule
  ],
  exports: [
    PrincipalComponent
  ] 
})
export class CrudModule { }
